        static bool ValidSeedDay1(int seed)
        {
            // DishOfTheDay
            if (Trash.Trash.getTrash(seed, 1, Trash.Trash.Can.Gus) != "194")
                return false;

            //int geode = Trash.Trash.getTrash(seed, 1, Trash.Trash.Can.Museum);

            //if (geode != 749)
            //    return false;

            //(int, int) content = Mines.GetGeodeContents(seed, 1, Geode.OmniGeode);
            //if (content.Item1 != 386 || content.Item2 != 11)
            //    return false;
            (int, int) item;
            int value = 0;
            item = Utility.GetArtifactspot(seed, 1, 29, 8, "Mountain");
            if (item.Item1 != 102)
            {
                value += int.Parse(ObjectInfo.ObjectInformation[item.Item1.ToString()].Split('/')[1]);
            }
            item = Utility.GetArtifactspot(seed, 1, 44, 16, "Beach");
            if (item.Item1 != 102)
            {
                value += int.Parse(ObjectInfo.ObjectInformation[item.Item1.ToString()].Split('/')[1]);
            }
            item = Utility.GetArtifactspot(seed, 1, 48, 25, "Forest");
            if (item.Item1 != 102)
            {
                value += int.Parse(ObjectInfo.ObjectInformation[item.Item1.ToString()].Split('/')[1]);
            }

            if (value < 2000)
            {
                return false;
            }

            return true;
        }

        static bool ValidSeedDay2(int seed, bool curate=false)
        {
            // DishOfTheDay
            if (Trash.Trash.getTrash(seed, 2, Trash.Trash.Can.Gus) != "194")
                return false;

            Beach beach = new Beach(seed);
            beach.Day = 2;

            beach.ProcessBubbles(Beach.map);

            int totalTime = 0;
            foreach (Bubbles bubbles in beach.Bubbles)
            {
                if (bubbles.Distance < 3 || bubbles.Tile.X > 57)
                {
                    continue;
                }
                totalTime += bubbles.TotalMinutes();
            }

            if (totalTime < 900)
            {
                return false;
            }
            if (curate)
            {
                int value = 0;
                Random random = new Random(seed + 2);
                for(int i=0; i<5; i++) { 
                    (int,int) content = Mines.GetGeodeContents(seed, i+2, Geode.Geode);
                    int cost = ObjectInfo.Items[content.Item1].Cost;
                    value += cost * content.Item2;
                }
                Console.WriteLine($"{seed}  {totalTime} {random.NextDouble()}    {value}");
            }

            return true;
        }

        static bool ValidSeedDay3(int gameId, bool curate = false)
        {
            Forest forest = new Forest(gameId);
            forest.Day = 3;

            forest.ProcessBubbles(Forest.map);

            int totalTime = 0;
            foreach (Bubbles bubbles in forest.Bubbles)
            {
                if (bubbles.Distance < 3 || 
                    bubbles.Tile.X < 52 && bubbles.Tile.Y < 41 ||
                    bubbles.Tile.X < 21 ||
                    bubbles.Tile.Y > 93)
                {
                    continue;
                }
                totalTime += bubbles.TotalMinutes();
            }

            if (totalTime < 960)
            {
                return false;
            }
            if (curate)
            {
                Random random = new Random(gameId + 3);
                Console.WriteLine($"{gameId}  {totalTime} {random.NextDouble()}");
            }


            return true;
        }
