        public static bool UsefulCarts(int seed)
        {

            var stock = TravelingCart.GetStock(seed);
            HashSet<int> stockIds = new HashSet<int>(stock.Select(o => o.Id));

            int count = stockIds.Intersect(LastTwoItems).Count();

            if (count < 2)
            {
                return false;
            }

            count = stockIds.Intersect(ArtisanItems).Count();

            if ( count < 3)
            {
                return false;
            }
            return true;
        }

